// src/index.tsx
import React, { useState, useEffect } from 'react';
import ReactDOM from 'react-dom';
import axios from 'axios';
import FarmTable from './FarmTable';
import FarmGraph from './FarmGraph';

const App: React.FC = () => {
  const [farms, setFarms] = useState<any[]>([]);

  useEffect(() => {
    axios.get('http://127.0.0.1:8080/api/farms')
      .then(response => {
        setFarms(response.data);
      })
      .catch(error => {
        console.error('Error fetching farms:', error);
      });
  }, []);

  return (
    <div className="App">
      <h1>Animal Movement Tracker</h1>
      <div>
        <h2>Farm List</h2>
        <div>
        <h2>Farm List (Table)</h2>
        <FarmTable data={farms} />
      </div>
      <div>
        <h2>Farm List (Graph)</h2>
        <FarmGraph data={farms} />
      </div>
      </div>

    </div>
  );
};

ReactDOM.render(
  <React.StrictMode>
    <App />
  </React.StrictMode>,
  document.getElementById('root')
);
